import React, { Component } from "react";

import { Helmet } from "react-helmet";

import Form from "../contact/form";

class Contact extends Component {
  componentDidMount() {}
  render() {
    return (
      <div className="contact">
        <Helmet>
          <title>Contact Me</title>
        </Helmet>
        <Form />
      </div>
    );
  }
}

export default Contact;
